      /* (387) stmt ::= stmt_do (OPTIMIZED OUT) */ assert(yyruleno!=387);
      /* (388) stmt ::= stmt_while (OPTIMIZED OUT) */ assert(yyruleno!=388);
      /* (389) space_begin ::= */ yytestcase(yyruleno==389);
      /* (390) space_begin ::= stmt_lvars scolon_space */ yytestcase(yyruleno==390);
      /* (391) stmt_if_chain ::= stmt_if (OPTIMIZED OUT) */ assert(yyruleno!=391);
      /* (392) stmt_if_chain ::= stmt_if_chain stmt_elif */ yytestcase(yyruleno==392);
