      /* (394) switch_case_exprs ::= switch_case_expr (OPTIMIZED OUT) */ assert(yyruleno!=394);
      /* (395) switch_case_exprs ::= switch_case_exprs COMMA_SPACE switch_case_expr */ yytestcase(yyruleno==395);
      /* (396) switch_case_paren_or_expr ::= lparen_or_space switch_case_exprs rparen_or_comma */ yytestcase(yyruleno==396);
      /* (397) switch_cases ::= switch_case (OPTIMIZED OUT) */ assert(yyruleno!=397);
